function tryTranslateKatakanaWord(en) {
	var ja = katakanaDictionary[en];
	if (typeof(ja)=='string') {
		if (ja==='') {
			return en;
		}
		if (typeof(dictionary[en+'_'])=='string') {
			return en;
		}
		if (typeof(dictionary[en+','])=='string') {
			return en;
		}
	}
	return ja;
}

function tryTranslateKatakana(word) {
	var cons = tryTranslateKatakanaWord(word);
	if (cons) return cons;
	for (var i=Math.min(maxKatakanaLength,word.length-1);i>0;i--) {
		var car = tryTranslateKatakanaWord(word.substr(0,i));
		if (!car) continue;
		var cdr = tryTranslateKatakana(word.substr(i));
		if (!cdr) continue;
		return car+cdr;
	}
	return null;
}

function translateKatakana(word) {
	return tryTranslateKatakana(word) || word;
}

function tryTranslateAlphabetWord(en,pattern,en_replace,ja_replace) {
	var match = en.match(pattern);
	if (match) {
		var word = en_replace ? en.replace(pattern, en_replace) : match[1];
		var ja = alphabetDictionary[word];
		if (ja) {
			if (ja_replace) {
				return ja_replace.replace('*',ja);
			} else {
				return ja;
			}
		}
	}
	return null;
}

function translateAlphabetWord(en) {
	var word = en.toLowerCase().replace("'",'-').replace(/ $/,'');
	return alphabetDictionary[word] ||
	tryTranslateAlphabetWord(word,/^(.+)(s|d|r|ing|in-|ly)$/) ||
	tryTranslateAlphabetWord(word,/^(.+)(es|ed|er|est|ness)$/) ||
	tryTranslateAlphabetWord(word,/^(.+)(ing|in-)$/,'$1e') ||
	tryTranslateAlphabetWord(word,/^(.+)(ies|ied|iness)$/,'$1y') ||
	tryTranslateAlphabetWord(word,/^(.+)(-s|al)$/,null,'*的') ||
	en;
}

function translateAlphabetSentence(en) {
	return en.replace(/[-'\w']+ ?/ig,translateAlphabetWord);
}

var half = {'０':'0', '１':'1', '２':'2', '３':'3', '４':'4', '５':'5', '６':'6', '７':'7', '８':'8', '９':'9'};
var unit1 = ['零', '一', '二', '三', '四', '五', '六', '七', '八', '九'];
var unit10 = ['', '十', '百', '千'];
var unit10000 = ['', '万', '億', '兆', '京', '垓', '秭', '穣', '溝', '澗', '正', '載', '極', '恒河沙', '阿僧祇', '那由他', '不可思議', '無量大数'];
var unit0 = ['分', '厘', '毛', '糸', '忽', '微', '繊', '沙', '塵', '埃', '渺', '漠', '模糊', '逡巡', '須臾', '瞬息', '弾指', '刹那', '六徳', '虚空', '清浄'];

function halve(double) {
	return half[double] || double;
}

function translateFigures(en) {
	var ja = '';
	for (var i=0;i<en.length;i++) {
		var digit = en.charAt(i);
		if (digit in half) {
			digit = half[digit];
		}
		if (digit in unit1) {
			ja += unit1[digit];
		} else {
			ja += digit;
		}
	}
	return ja;
}

function translateNumber(en) {
	var parts = en.replace(/[０-９]/g, halve).replace(/[,'']/g, '').split(/[.．]/);
	var trunc = parts[0] || '';
	var fract = parts[1] || '';
	var ja = '';
	var zero = true;
	for (var i=0;i<trunc.length;i++) {
		var digit = +trunc.charAt(i);
		var exponent = trunc.length-i-1;
		var exponent10 = exponent%4;
		var exponent10000 = (exponent-exponent10)*0.25;
		if (digit>0) {
			if (digit>1 || exponent10==0 || exponent10==3 && exponent10000 > 0) {
				ja += unit1[digit];
			}
			ja += unit10[exponent10];
			zero = false;
		}
		if (exponent%4==0) {
			if (!zero) {
				ja += unit10000[exponent10000];
			}
			zero = true;
		}
	}
	if (+trunc) {
		if (+fract) {
			ja += 'と';
		} else {
		}
	} else {
		if (+fract) {
		} else {
			ja += '零';
		}
	}
	for (var i=0;i<fract.length;i++) {
		var digit = +fract.charAt(i);
		if (digit>0) {
			ja += unit1[digit];
			ja += unit0[i] || '';
		}
	}
	return ja;
}

function translateAlphabetSingleWord(en) {
	var matches = en.match(/[a-z]+/ig);
	if (matches && matches.length == 1) {
		var word = matches[0].toLowerCase();
		word = alphabetSingleWordDictionary[word] || alphabetSingleWordDictionary[word.replace(/(s|ing)$/,'')];
		if (word) {
			return en.replace(/[a-z]+/i,word);
		}
	}
	return en;
}

/* ancientter */

if (self.ancientter === undefined) {
    ancientter = {};

    ancientter.translate = (text) => {
        text = text.replace(/[-'a-z'.,!? ]+/ig,translateAlphabetSingleWord);
        text = text.replace(/[ァア-ンヴーヵヶ]+/g,translateKatakana);
        text = tokenize(text,13);
        for (i in table) {
            text = text.replace(table[i][0],table[i][1]);
        }
        text = untokenize(text);
        text = text.replace(/[-'a-z']+([.,!? ]+[-'a-z']+)+|\n[-'a-z']+[.,!?]*\n/ig,translateAlphabetSentence);
        text = text.replace(/\d{73,}|([０-９]){73,}/g,translateFigures);
        text = text.replace(/\b(0|[1-9]\d{0,2}(([,'']\d{3})*|\d*))(\.\d+)?\b/g,translateNumber);
        text = text.replace(/[１-９][０-９]*([.．][０-９]+)?/g,translateNumber);
        text = text.replace(/\d+|([０-９])+/g,translateFigures);
        return text;
    };

    ancientter.update = () => {
        $('*').contents().filter(function () {
            if (this.tagName)
            if (!['script', 'style'].includes(this.tagName.toLowerCase()))
            if (this.childElementCount == 0)
            if (this.firstChild)
            if (this.firstChild.nodeType == 3) {
                return true;
            }
            return false;
        }).each(function () {
            const input = $(this).attr('data-ancientter-original') || $(this).text();
            $(this).attr('data-ancientter-original', input);
            const output = ancientter.translate(input);
            $(this).text(output);
        });
    };

    ancientter.updater = setInterval(() => {
        ancientter.update();
    }, 100);
} else {
    $('[data-ancientter-original]').each(function () {
        const input = $(this).attr('data-ancientter-original');
        $(this).text(input);
        $(this).removeAttr('data-ancientter-original');
    });

    clearInterval(ancientter.updater);

    delete ancientter;
}
